import './LivroEstante.css'

function LivroEstante(props){

if(props.escolhido){
    return(
        <div className='LivroEstanteEscolhido'></div>
        )
}else{
    return(
        <div className='LivroEstante'></div>
        ) 
}

}
export default LivroEstante;
